import React, { useEffect, useState } from 'react';
import { getUserGrievances } from '../services/api';
import './Navbar.css';
// In Profile.js
const Profile = ({ userEmail }) => {
  const [grievances, setGrievances] = useState([]);

  useEffect(() => {
    // Assume fetchUserGrievances is an API call defined in api.js
    fetchUserGrievances(userEmail).then(data => {
      setGrievances(data);
    });
  }, [userEmail]);

  return (
    <div>
      <h1>Your Grievances</h1>
      <table>
        <thead>
          <tr>
            <th>Type</th>
            <th>Description</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {grievances.map(grievance => (
            <tr key={grievance.id}>
              <td>{grievance.type}</td>
              <td>{grievance.description}</td>
              <td>{grievance.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
